import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate, Link } from 'react-router-dom';

const Login = () => {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const { login } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    const result = await login(formData.email, formData.password);

    if (result.success) {
      navigate('/dashboard');
    } else {
      setError(result.error);
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <style>
        {`
          body, html {
            background: linear-gradient(135deg, #0a0f2c, #2b0033);
            color: #fff;
            font-family: 'Poppins', sans-serif;
            margin: 0;
            height: 100%;
          }
          input::placeholder {
            color: #aaa;
          }
          input:focus {
            border-color: #6a11cb;
            outline: none;
            background: rgba(255, 255, 255, 0.15);
          }
          .error {
            background: rgba(255, 0, 0, 0.15);
            color: #ff6b6b;
            padding: 10px;
            border-radius: 8px;
            text-align: center;
            margin-bottom: 15px;
            font-size: 14px;
          }
          a:hover {
            text-decoration: underline;
          }
        `}
      </style>

      <div style={styles.card}>
        <div style={styles.header}>
          <h1 style={styles.title}>AiThor</h1>
          <p style={styles.subtitle}>Login to your account</p>
        </div>

        <form onSubmit={handleSubmit}>
          <div style={styles.group}>
            <label style={styles.label}>Email Address</label>
            <input
              type="email"
              name="email"
              style={styles.input}
              value={formData.email}
              onChange={handleChange}
              required
              placeholder="Enter your email"
            />
          </div>

          <div style={styles.group}>
            <label style={styles.label}>Password</label>
            <input
              type="password"
              name="password"
              style={styles.input}
              value={formData.password}
              onChange={handleChange}
              required
              placeholder="Enter your password"
            />
          </div>

          {error && <div className="error">{error}</div>}

          <button type="submit" style={styles.button} disabled={loading}>
            {loading ? 'Logging in...' : 'Login'}
          </button>
        </form>

        <div style={styles.footer}>
          <p>
            Don't have an account?{' '}
            <Link to="/register" style={styles.link}>
              Create Account
            </Link>
          </p>
        </div>
      </div>
    </div>
  );
};

const styles = {
  page: {
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '20px',
  },
  card: {
    background: 'rgba(255, 255, 255, 0.05)',
    backdropFilter: 'blur(15px)',
    borderRadius: '16px',
    padding: '30px',
    boxShadow: '0 4px 30px rgba(0, 0, 0, 0.5)',
    width: '100%',
    maxWidth: '400px',
  },
  header: { textAlign: 'center', marginBottom: '25px' },
  title: {
    background: 'linear-gradient(90deg, #6a11cb, #2575fc)',
    WebkitBackgroundClip: 'text',
    WebkitTextFillColor: 'transparent',
    fontSize: '2rem',
    fontWeight: '700',
    marginBottom: '10px',
  },
  subtitle: { color: '#aaa', marginBottom: '20px' },
  group: { marginBottom: '20px' },
  label: { display: 'block', marginBottom: '8px', fontWeight: '600', color: '#ccc' },
  input: {
    width: '100%',
    padding: '12px',
    borderRadius: '8px',
    border: '1px solid #444',
    background: 'rgba(255, 255, 255, 0.1)',
    color: '#fff',
    fontSize: '15px',
    transition: 'all 0.3s ease',
  },
  button: {
    width: '100%',
    background: 'linear-gradient(90deg, #6a11cb, #2575fc)',
    color: '#fff',
    fontWeight: '600',
    border: 'none',
    borderRadius: '8px',
    padding: '12px',
    cursor: 'pointer',
    transition: '0.3s',
  },
  footer: { textAlign: 'center', marginTop: '15px', color: '#aaa' },
  link: { color: '#6a11cb', fontWeight: '600', textDecoration: 'none' },
};

export default Login;
